import React from 'react';
import Navbar from '../Navbar/Navbar';
import './Style.css'

function Home(props) {
    return (
        <React.Fragment>
           <Navbar />
           <div className="body">
               <div>Welcome to Caleb Mobile Waiter CWM</div>
           </div>
        </React.Fragment>
    );
}
export default Home;
